import React from "react";

const projects = [
  { title: "Aplikasi Inventory", description: "Aplikasi berbasis Flutter dengan pemindai barcode.", link: "#" },
  { title: "HomeTasker", description: "Platform untuk penyedia jasa rumah tangga.", link: "#" },
  { title: "OpenMusic API", description: "Backend API dengan fitur manajemen playlist kolaboratif.", link: "#" },
  { title: "Wedding Organizer", description: "Website untuk manajemen acara pernikahan.", link: "#" },
  { title: "Pariwisata Digital", description: "Aplikasi Java Spring Boot untuk informasi wisata.", link: "#" },
  { title: "OpenMusic API", description: "Backend API dengan fitur manajemen playlist kolaboratif.", link: "#" },
  { title: "Wedding Organizer", description: "Website untuk manajemen acara pernikahan.", link: "#" },
  { title: "Pariwisata Digital", description: "Aplikasi Java Spring Boot untuk informasi wisata.", link: "#" },
  { title: "OpenMusic API", description: "Backend API dengan fitur manajemen playlist kolaboratif.", link: "#" },
  { title: "Wedding Organizer", description: "Website untuk manajemen acara pernikahan.", link: "#" },
  { title: "Pariwisata Digital", description: "Aplikasi Java Spring Boot untuk informasi wisata.", link: "#" }
];

const Projects = () => {
  return (
    <section id="projects" style={{ padding: "50px", textAlign: "center" }}>
      <h2>Proyek</h2>
      <div 
        style={{ 
          overflowX: "scroll", 
          whiteSpace: "nowrap", 
          padding: "20px", 
          scrollbarWidth: "none", // Firefox
          msOverflowStyle: "none" // Internet Explorer & Edge
        }}
      >
        <div 
          style={{ 
            display: "flex", 
            gap: "20px"
          }}
        >
          {projects.map((project, index) => (
            <div 
              key={index} 
              style={{
                minWidth: "250px", 
                maxWidth: "300px", 
                padding: "20px", 
                border: "1px solid #ddd",
                borderRadius: "10px",
                textAlign: "left",
                background: "#f9f9f9",
                boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
                overflow: "hidden"
              }}
            >
              <h3>{project.title}</h3>
              <p 
                style={{
                  overflow: "hidden",
                  display: "-webkit-box",
                  WebkitBoxOrient: "vertical",
                  WebkitLineClamp: 1, // Menampilkan hanya 2 baris, sisanya akan disingkat
                  textOverflow: "ellipsis"
                }}
              >
                {project.description}
              </p>
              <a href={project.link} target="_blank" rel="noopener noreferrer">Lihat Proyek</a>
            </div>
          ))}
        </div>
      </div>
      <style>
        {`
          /* Menyembunyikan scrollbar di Chrome, Safari */
          #projects div::-webkit-scrollbar {
            display: none;
          }
        `}
      </style>
    </section>
  );
};

export default Projects;
